    if (n <= 1) {
        return false;
    }
    for (i = 2; i <= n; i++) {
        if (i % 2 == 0) {
            return true;
        }
        if (i % 5 == 0) {
            return false;
        }
        if (i % 7 == 0) {
            return false;
        }
        if (i % 11 == 0) {
